import React from 'react';
import {Carousel} from 'react-bootstrap';
import styled from 'styled-components';
import bkg from '../assets/florarie.png';
import mino from '../assets/mino-copy.png';
import bkg2 from '../assets/florarie2-copy-2.png';

const Styles = styled.div`
    #jumbotron1 {
        background: url(${bkg}) no-repeat;
        background-size: cover;
        color: #ccc;
        height: 700px;
        position: relative;
        z-index: -2;
    }

    #jumbotron2 {
        background: url(${mino}) no-repeat;
        background-size: cover;
        color: #ccc;
        height: 700px;
        position: relative;
        z-index: -2;
    }

    #jumbotron3 {
        background: url(${bkg2}) no-repeat;
        background-size: cover;
        color: #ccc;
        height: 700px;
        position: relative;
        z-index: -2;
    }

    .overlay {
        background-color: #000;
        opacity: 0.6;
        position: absolute;
        top: 0;
        left: 0;
        bottom: 0;
        right: 0;
        z-index: -1;
    }
`;

export const Jumbotron = () => (
    <Styles>
        <Carousel interval="2500" pause="hover">
            <Carousel.Item id="jumbotron1">
                <div className="overlay"></div>
                <Carousel.Caption>
                <h2 style={{fontSize:"50px"}}>Livrari la domiciliu</h2>
                <p style={{fontSize:"20px"}}>Oricand la dispozitia ta!</p>
                </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item id="jumbotron2">
                <div className="overlay"></div>
                <Carousel.Caption>
                <h2 style={{fontSize:"50px"}}>Flori pentru evenimente</h2>
                <p style={{fontSize:"20px"}}>Comenzi buchete de flori!</p>
                </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item id="jumbotron3">
                <div className="overlay"></div>
                <Carousel.Caption>
                <h2 style={{fontSize:"50px"}}>Cadouri. Aranjamente.</h2>
                <p style={{fontSize:"20px"}}> Trimite flori online!</p>
                </Carousel.Caption>
            </Carousel.Item>
        </Carousel>
    </Styles>
)
